import ScrollToTop from "./components/ScrollToTop"


function App() {
  return (
    <div>
      <Suspense fallback={null}>
        <GlobalStyle />
        <Header />
        <Home />
        <Footer />
         Hi There!
        <ScrollToTop />
      </Suspense>
    </div>
  );
}

export default App;
